Now I have all the information needed to create a comprehensive implementation plan. Let me compile everything into a detailed design document.

---

# ClimateHome iOS PoC - Implementation Plan

La Boeuf, here is a detailed implementation plan for the ClimateHome Proof of Concept. This plan focuses on validating your four risky assumptions with minimal code and maximum learning.

---

## 1. Project Structure

```
ClimateHome/
├── ClimateHomeApp.swift           # App entry point (existing)
├── ContentView.swift              # Main search screen (modify existing)
│
├── Models/
│   ├── Coordinate.swift           # Simple lat/lng struct
│   ├── GeocodingResult.swift      # Census API response model
│   ├── WildfireRisk.swift         # WA DNR WUI response model
│   ├── FloodRisk.swift            # FEMA NFHL response model
│   ├── AirQualityRisk.swift       # EPA AirNow response model
│   └── PropertyRiskReport.swift   # Aggregated risk data
│
├── Services/
│   ├── NetworkError.swift         # Unified error types
│   ├── APIClient.swift            # Base networking with URLSession
│   ├── GeocodingService.swift     # Census Geocoder integration
│   ├── WildfireService.swift      # WA DNR WUI queries
│   ├── FloodService.swift         # FEMA NFHL queries
│   └── AirQualityService.swift    # EPA AirNow queries
│
├── ViewModels/
│   └── RiskLookupViewModel.swift  # Main view model (@Observable)
│
├── Views/
│   ├── AddressInputView.swift     # Search field + button
│   ├── RiskResultsView.swift      # Display aggregated results
│   ├── RiskCardView.swift         # Individual risk category card
│   └── LoadingView.swift          # Loading state indicator
│
└── Utilities/
    └── RiskLevel.swift            # Risk level enum (low/moderate/high)
```

---

## 2. Model Definitions

### 2.1 Core Types

```swift
// ABOUTME: Represents geographic coordinates for API queries
// ABOUTME: Used throughout the app for location-based risk lookups

struct Coordinate: Codable, Sendable {
    let latitude: Double
    let longitude: Double
}
```

```swift
// ABOUTME: Standardized risk levels across all data sources
// ABOUTME: Maps to visual indicators (green/yellow/red)

enum RiskLevel: String, CaseIterable {
    case low = "Low"
    case moderate = "Moderate"
    case high = "High"
    case unknown = "Unknown"

    var color: Color {
        switch self {
        case .low: return .green
        case .moderate: return .yellow
        case .high: return .red
        case .unknown: return .gray
        }
    }

    var emoji: String {
        switch self {
        case .low: return "checkmark.circle.fill"
        case .moderate: return "exclamationmark.triangle.fill"
        case .high: return "xmark.octagon.fill"
        case .unknown: return "questionmark.circle.fill"
        }
    }
}
```

### 2.2 API Response Models

**Census Geocoding Response:**

```swift
// ABOUTME: Decodes Census Bureau Geocoding API JSON response
// ABOUTME: Extracts coordinates from matched address results

struct CensusGeocodeResponse: Codable {
    let result: CensusResult
}

struct CensusResult: Codable {
    let addressMatches: [AddressMatch]
}

struct AddressMatch: Codable {
    let matchedAddress: String
    let coordinates: CensusCoordinates

    struct CensusCoordinates: Codable {
        let x: Double  // longitude
        let y: Double  // latitude
    }
}
```

**WA DNR WUI Response (ArcGIS REST):**

```swift
// ABOUTME: Decodes WA DNR Wildland-Urban Interface query response
// ABOUTME: WUI_DESC_NM field contains classification text

struct WUIQueryResponse: Codable {
    let features: [WUIFeature]
}

struct WUIFeature: Codable {
    let attributes: WUIAttributes
}

struct WUIAttributes: Codable {
    let OBJECTID: Int?
    let VALUE: Int?
    let WUI_DESC_NM: String?  // e.g., "Interface", "Intermix", null
}
```

**FEMA NFHL Response (ArcGIS REST):**

```swift
// ABOUTME: Decodes FEMA National Flood Hazard Layer query response
// ABOUTME: FLD_ZONE field contains flood zone designation (X, AE, VE, etc.)

struct NFHLQueryResponse: Codable {
    let features: [NFHLFeature]
}

struct NFHLFeature: Codable {
    let attributes: NFHLAttributes
}

struct NFHLAttributes: Codable {
    let FLD_ZONE: String?      // e.g., "X", "AE", "VE"
    let ZONE_SUBTY: String?    // Subtype description
    let SFHA_TF: String?       // Special Flood Hazard Area (T/F)
}
```

**EPA AirNow Response:**

```swift
// ABOUTME: Decodes EPA AirNow current observation API response
// ABOUTME: Returns array of observations for different parameters (PM2.5, O3)

struct AirNowObservation: Codable {
    let DateObserved: String
    let HourObserved: Int
    let LocalTimeZone: String
    let ReportingArea: String
    let StateCode: String
    let Latitude: Double
    let Longitude: Double
    let ParameterName: String  // "PM2.5", "O3"
    let AQI: Int
    let Category: AQICategory
}

struct AQICategory: Codable {
    let Number: Int
    let Name: String  // "Good", "Moderate", "Unhealthy for Sensitive Groups", etc.
}
```

### 2.3 Aggregated Result Model

```swift
// ABOUTME: Aggregates all risk data for a single property lookup
// ABOUTME: Tracks timing, errors, and data availability for PoC validation

struct PropertyRiskReport {
    let address: String
    let formattedAddress: String?
    let coordinate: Coordinate?

    // Individual risk results (nil = not queried or failed)
    var wildfireRisk: WildfireRiskResult?
    var floodRisk: FloodRiskResult?
    var airQualityRisk: AirQualityRiskResult?

    // Timing for UX validation
    var geocodingTimeMs: Int?
    var totalTimeMs: Int?

    // Error tracking
    var errors: [String] = []
}

struct WildfireRiskResult {
    let level: RiskLevel
    let wuiClassification: String?  // "Interface", "Intermix", or nil
    let summary: String
    let dataSource: String
}

struct FloodRiskResult {
    let level: RiskLevel
    let floodZone: String?  // "X", "AE", "VE", etc.
    let isSpecialFloodHazardArea: Bool
    let summary: String
    let dataSource: String
}

struct AirQualityRiskResult {
    let level: RiskLevel
    let currentAQI: Int?
    let category: String?
    let summary: String
    let dataSource: String
}
```

---

## 3. Networking Layer Design

### 3.1 Base API Client

```swift
// ABOUTME: Centralized URLSession wrapper with async/await
// ABOUTME: Handles common concerns: timeouts, status codes, JSON decoding

actor APIClient {
    static let shared = APIClient()

    private let session: URLSession
    private let decoder: JSONDecoder

    private init() {
        let config = URLSessionConfiguration.default
        config.timeoutIntervalForRequest = 15  // 15 second timeout for PoC
        config.timeoutIntervalForResource = 30
        self.session = URLSession(configuration: config)
        self.decoder = JSONDecoder()
    }

    func fetch<T: Decodable>(_ url: URL) async throws -> T {
        let (data, response) = try await session.data(from: url)

        guard let httpResponse = response as? HTTPURLResponse else {
            throw NetworkError.invalidResponse
        }

        guard (200...299).contains(httpResponse.statusCode) else {
            throw NetworkError.httpError(statusCode: httpResponse.statusCode)
        }

        return try decoder.decode(T.self, from: data)
    }
}
```

### 3.2 Error Types

```swift
// ABOUTME: Unified error types for all API calls
// ABOUTME: Provides user-friendly messages for UI display

enum NetworkError: LocalizedError {
    case invalidURL
    case invalidResponse
    case httpError(statusCode: Int)
    case decodingError(underlying: Error)
    case noData
    case geocodingFailed(reason: String)
    case serviceUnavailable(service: String)

    var errorDescription: String? {
        switch self {
        case .invalidURL:
            return "Invalid URL configuration"
        case .invalidResponse:
            return "Invalid server response"
        case .httpError(let code):
            return "Server error (HTTP \(code))"
        case .decodingError:
            return "Unable to parse response"
        case .noData:
            return "No data returned"
        case .geocodingFailed(let reason):
            return "Address lookup failed: \(reason)"
        case .serviceUnavailable(let service):
            return "\(service) is currently unavailable"
        }
    }
}
```

### 3.3 Service Implementations

**Geocoding Service:**

```swift
// ABOUTME: Wraps Census Bureau Geocoding API for address lookup
// ABOUTME: Uses onelineaddress endpoint for simpler input handling

struct GeocodingService {
    private let baseURL = "https://geocoding.geo.census.gov/geocoder/locations/onelineaddress"

    func geocode(address: String) async throws -> (Coordinate, String) {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        components.queryItems = [
            URLQueryItem(name: "address", value: address),
            URLQueryItem(name: "benchmark", value: "Public_AR_Current"),
            URLQueryItem(name: "format", value: "json")
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let response: CensusGeocodeResponse = try await APIClient.shared.fetch(url)

        guard let match = response.result.addressMatches.first else {
            throw NetworkError.geocodingFailed(reason: "No matching address found")
        }

        let coordinate = Coordinate(
            latitude: match.coordinates.y,
            longitude: match.coordinates.x
        )

        return (coordinate, match.matchedAddress)
    }
}
```

**Wildfire Service (WA DNR WUI):**

```swift
// ABOUTME: Queries WA DNR WUI MapServer for wildfire interface classification
// ABOUTME: Uses ArcGIS REST query endpoint with point geometry

struct WildfireService {
    private let baseURL = "https://gis.dnr.wa.gov/site3/rest/services/Public_Wildfire/WADNR_PUBLIC_WD_WUI/MapServer/0/query"

    func checkWUI(at coordinate: Coordinate) async throws -> WildfireRiskResult {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        // ArcGIS point geometry format: {"x": lng, "y": lat}
        let geometryJSON = "{\"x\":\(coordinate.longitude),\"y\":\(coordinate.latitude)}"

        components.queryItems = [
            URLQueryItem(name: "geometry", value: geometryJSON),
            URLQueryItem(name: "geometryType", value: "esriGeometryPoint"),
            URLQueryItem(name: "inSR", value: "4326"),
            URLQueryItem(name: "spatialRel", value: "esriSpatialRelIntersects"),
            URLQueryItem(name: "outFields", value: "WUI_DESC_NM,VALUE"),
            URLQueryItem(name: "returnGeometry", value: "false"),
            URLQueryItem(name: "f", value: "json")
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let response: WUIQueryResponse = try await APIClient.shared.fetch(url)

        return parseWUIResponse(response)
    }

    private func parseWUIResponse(_ response: WUIQueryResponse) -> WildfireRiskResult {
        guard let feature = response.features.first,
              let classification = feature.attributes.WUI_DESC_NM else {
            return WildfireRiskResult(
                level: .low,
                wuiClassification: nil,
                summary: "Not in Wildland-Urban Interface zone",
                dataSource: "WA DNR WUI 2019"
            )
        }

        let level: RiskLevel
        switch classification.lowercased() {
        case "interface":
            level = .high
        case "intermix":
            level = .moderate
        default:
            level = .low
        }

        return WildfireRiskResult(
            level: level,
            wuiClassification: classification,
            summary: "WUI Classification: \(classification)",
            dataSource: "WA DNR WUI 2019"
        )
    }
}
```

**Flood Service (FEMA NFHL):**

```swift
// ABOUTME: Queries FEMA NFHL MapServer for flood zone classification
// ABOUTME: Layer 28 (S_Fld_Haz_Ar) contains regulatory flood zones

struct FloodService {
    private let baseURL = "https://hazards.fema.gov/gis/nfhl/rest/services/public/NFHL/MapServer/28/query"

    func checkFloodZone(at coordinate: Coordinate) async throws -> FloodRiskResult {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        // FEMA uses lon,lat format for point geometry
        let geometry = "\(coordinate.longitude),\(coordinate.latitude)"

        components.queryItems = [
            URLQueryItem(name: "geometry", value: geometry),
            URLQueryItem(name: "geometryType", value: "esriGeometryPoint"),
            URLQueryItem(name: "inSR", value: "4326"),
            URLQueryItem(name: "spatialRel", value: "esriSpatialRelWithin"),
            URLQueryItem(name: "outFields", value: "FLD_ZONE,ZONE_SUBTY,SFHA_TF"),
            URLQueryItem(name: "returnGeometry", value: "false"),
            URLQueryItem(name: "f", value: "json")
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let response: NFHLQueryResponse = try await APIClient.shared.fetch(url)

        return parseFloodResponse(response)
    }

    private func parseFloodResponse(_ response: NFHLQueryResponse) -> FloodRiskResult {
        guard let feature = response.features.first,
              let zone = feature.attributes.FLD_ZONE else {
            return FloodRiskResult(
                level: .unknown,
                floodZone: nil,
                isSpecialFloodHazardArea: false,
                summary: "No flood zone data available",
                dataSource: "FEMA NFHL"
            )
        }

        let isSFHA = feature.attributes.SFHA_TF == "T"
        let level: RiskLevel

        switch zone.uppercased() {
        case "X", "AREA NOT INCLUDED":
            level = .low
        case "A", "AE", "AH", "AO", "AR":
            level = .high
        case "V", "VE":
            level = .high  // Coastal high velocity
        case "D":
            level = .moderate  // Undetermined
        default:
            level = .moderate
        }

        let summary = isSFHA 
            ? "Zone \(zone) - Special Flood Hazard Area"
            : "Zone \(zone) - Minimal flood hazard"

        return FloodRiskResult(
            level: level,
            floodZone: zone,
            isSpecialFloodHazardArea: isSFHA,
            summary: summary,
            dataSource: "FEMA NFHL"
        )
    }
}
```

**Air Quality Service (EPA AirNow):**

```swift
// ABOUTME: Queries EPA AirNow API for current air quality observations
// ABOUTME: Requires free API key (stored in Config or environment)

struct AirQualityService {
    private let baseURL = "https://www.airnowapi.org/aq/observation/latLong/current/"
    private let apiKey: String  // Pass in from config

    init(apiKey: String) {
        self.apiKey = apiKey
    }

    func checkAirQuality(at coordinate: Coordinate) async throws -> AirQualityRiskResult {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        components.queryItems = [
            URLQueryItem(name: "latitude", value: String(coordinate.latitude)),
            URLQueryItem(name: "longitude", value: String(coordinate.longitude)),
            URLQueryItem(name: "distance", value: "25"),  // 25 mile radius
            URLQueryItem(name: "format", value: "application/json"),
            URLQueryItem(name: "API_KEY", value: apiKey)
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let observations: [AirNowObservation] = try await APIClient.shared.fetch(url)

        return parseAirQualityResponse(observations)
    }

    private func parseAirQualityResponse(_ observations: [AirNowObservation]) -> AirQualityRiskResult {
        // Find worst AQI among all parameters (PM2.5, O3, etc.)
        guard let worstObs = observations.max(by: { $0.AQI < $1.AQI }) else {
            return AirQualityRiskResult(
                level: .unknown,
                currentAQI: nil,
                category: nil,
                summary: "No air quality data available",
                dataSource: "EPA AirNow"
            )
        }

        let level: RiskLevel
        switch worstObs.Category.Number {
        case 1:  // Good (0-50)
            level = .low
        case 2:  // Moderate (51-100)
            level = .low
        case 3:  // USG (101-150)
            level = .moderate
        default: // Unhealthy and above
            level = .high
        }

        return AirQualityRiskResult(
            level: level,
            currentAQI: worstObs.AQI,
            category: worstObs.Category.Name,
            summary: "AQI \(worstObs.AQI) - \(worstObs.Category.Name)",
            dataSource: "EPA AirNow"
        )
    }
}
```

