## 5. View Hierarchy

### 5.1 Main Content View

```swift
// ABOUTME: Root view containing address input and results display
// ABOUTME: Single-screen PoC layout for mobile

import SwiftUI

struct ContentView: View {
    @State private var viewModel = RiskLookupViewModel(
        airNowAPIKey: "YOUR_API_KEY_HERE"  // Replace with actual key
    )

    var body: some View {
        NavigationStack {
            ScrollView {
                VStack(spacing: 24) {
                    AddressInputView(
                        address: $viewModel.addressInput,
                        isLoading: viewModel.isLoading,
                        onSubmit: {
                            Task { await viewModel.performLookup() }
                        }
                    )

                    if let error = viewModel.errorMessage {
                        ErrorBannerView(message: error)
                    }

                    if viewModel.isLoading {
                        LoadingView()
                    }

                    if let report = viewModel.currentReport {
                        RiskResultsView(report: report)
                    }
                }
                .padding()
            }
            .navigationTitle("ClimateHome")
        }
    }
}
```

