### 5.3 Risk Results View

```swift
// ABOUTME: Displays aggregated risk results in card layout
// ABOUTME: Shows timing data for PoC validation

struct RiskResultsView: View {
    let report: PropertyRiskReport

    var body: some View {
        VStack(alignment: .leading, spacing: 16) {
            // Address header
            if let formatted = report.formattedAddress {
                Text(formatted)
                    .font(.headline)
            }

            // Timing info (PoC validation)
            if let totalMs = report.totalTimeMs {
                Text("Loaded in \(totalMs)ms")
                    .font(.caption)
                    .foregroundStyle(.secondary)
            }

            // Risk cards
            VStack(spacing: 12) {
                if let wildfire = report.wildfireRisk {
                    RiskCardView(
                        title: "Wildfire",
                        icon: "flame.fill",
                        result: wildfire.level,
                        summary: wildfire.summary,
                        source: wildfire.dataSource
                    )
                }

                if let flood = report.floodRisk {
                    RiskCardView(
                        title: "Flood",
                        icon: "drop.fill",
                        result: flood.level,
                        summary: flood.summary,
                        source: flood.dataSource
                    )
                }

                if let air = report.airQualityRisk {
                    RiskCardView(
                        title: "Air Quality",
                        icon: "aqi.medium",
                        result: air.level,
                        summary: air.summary,
                        source: air.dataSource
                    )
                }
            }

            // Errors section
            if !report.errors.isEmpty {
                VStack(alignment: .leading, spacing: 4) {
                    Text("Data Issues")
                        .font(.caption)
                        .fontWeight(.semibold)
                    ForEach(report.errors, id: \.self) { error in
                        Text("- \(error)")
                            .font(.caption2)
                            .foregroundStyle(.red)
                    }
                }
                .padding()
                .background(Color.red.opacity(0.1))
                .cornerRadius(8)
            }
        }
    }
}
```

### 5.4 Risk Card View

```swift
// ABOUTME: Individual risk category display card
// ABOUTME: Shows icon, level indicator, summary, and data source

struct RiskCardView: View {
    let title: String
    let icon: String
    let result: RiskLevel
    let summary: String
    let source: String

    var body: some View {
        HStack(spacing: 12) {
            // Icon
            Image(systemName: icon)
                .font(.title2)
                .frame(width: 32)
                .foregroundStyle(result.color)

            // Content
            VStack(alignment: .leading, spacing: 4) {
                HStack {
                    Text(title)
                        .font(.headline)
                    Spacer()
                    Label(result.rawValue, systemImage: result.emoji)
                        .font(.subheadline)
                        .fontWeight(.medium)
                        .foregroundStyle(result.color)
                }

                Text(summary)
                    .font(.subheadline)
                    .foregroundStyle(.secondary)

                Text("Source: \(source)")
                    .font(.caption2)
                    .foregroundStyle(.tertiary)
            }
        }
        .padding()
        .background(Color(.systemGray6))
        .cornerRadius(12)
    }
}
```

