## 6. Implementation Order

### Phase 1: Foundation (Day 1)
1. **Create project structure** - Add folders for Models, Services, ViewModels, Views, Utilities
2. **Implement NetworkError.swift** - Error types
3. **Implement APIClient.swift** - Base networking
4. **Implement Coordinate.swift and RiskLevel.swift** - Core types

### Phase 2: Geocoding (Day 1-2)
5. **Implement GeocodingService.swift** - Census API integration
6. **Create GeocodingResult.swift** - Response models
7. **Write unit test for geocoding** - Test with known WA address
8. **Manual validation** - Test in simulator with real addresses

### Phase 3: WA DNR Wildfire (Day 2)
9. **Implement WildfireService.swift** - WUI query
10. **Create WildfireRisk.swift** - Response models
11. **Write unit test** - Test with coordinates in/out of WUI
12. **Manual validation** - Verify against WA DNR map viewer

### Phase 4: FEMA Flood (Day 2-3)
13. **Implement FloodService.swift** - NFHL query
