```swift
// ABOUTME: Main view model for risk lookup screen
// ABOUTME: Uses iOS 17+ @Observable macro for automatic SwiftUI updates

import SwiftUI
import Observation

@Observable
class RiskLookupViewModel {
    // Input
    var addressInput: String = ""

    // State
    var isLoading: Bool = false
    var currentReport: PropertyRiskReport?
    var errorMessage: String?

    // Timing (for PoC validation)
    var lastLookupDuration: TimeInterval?

    // Services
    private let geocodingService = GeocodingService()
    private let wildfireService = WildfireService()
    private let floodService = FloodService()
    private let airQualityService: AirQualityService?

    init(airNowAPIKey: String? = nil) {
        if let key = airNowAPIKey {
            self.airQualityService = AirQualityService(apiKey: key)
        } else {
            self.airQualityService = nil
        }
    }

    @MainActor
    func performLookup() async {
        guard !addressInput.trimmingCharacters(in: .whitespaces).isEmpty else {
            errorMessage = "Please enter an address"
            return
        }

        isLoading = true
        errorMessage = nil
        currentReport = nil

        let startTime = Date()
        var report = PropertyRiskReport(
            address: addressInput,
            formattedAddress: nil,
            coordinate: nil
        )

        do {
            // Step 1: Geocode address
            let geocodeStart = Date()
            let (coordinate, formattedAddress) = try await geocodingService.geocode(address: addressInput)
            report.geocodingTimeMs = Int(Date().timeIntervalSince(geocodeStart) * 1000)
            report = PropertyRiskReport(
                address: addressInput,
                formattedAddress: formattedAddress,
                coordinate: coordinate
            )

            // Step 2: Query risk APIs in parallel
            await withTaskGroup(of: Void.self) { group in
                // Wildfire (WA DNR WUI)
                group.addTask {
                    do {
                        let result = try await self.wildfireService.checkWUI(at: coordinate)
                        await MainActor.run { report.wildfireRisk = result }
                    } catch {
                        await MainActor.run { 
                            report.errors.append("Wildfire: \(error.localizedDescription)")
                        }
                    }
                }

                // Flood (FEMA NFHL)
                group.addTask {
                    do {
                        let result = try await self.floodService.checkFloodZone(at: coordinate)
                        await MainActor.run { report.floodRisk = result }
                    } catch {
                        await MainActor.run {
                            report.errors.append("Flood: \(error.localizedDescription)")
                        }
                    }
                }

                // Air Quality (EPA AirNow) - only if API key provided
                if let airService = self.airQualityService {
                    group.addTask {
                        do {
                            let result = try await airService.checkAirQuality(at: coordinate)
                            await MainActor.run { report.airQualityRisk = result }
                        } catch {
                            await MainActor.run {
                                report.errors.append("Air Quality: \(error.localizedDescription)")
                            }
                        }
                    }
                }
            }

            report.totalTimeMs = Int(Date().timeIntervalSince(startTime) * 1000)
            lastLookupDuration = Date().timeIntervalSince(startTime)
            currentReport = report

        } catch {
            errorMessage = error.localizedDescription
        }

        isLoading = false
    }
}
```

