// ABOUTME: Centralized URLSession wrapper with async/await for ClimateHome
// ABOUTME: Handles common concerns: timeouts, status codes, JSON decoding

import Foundation

actor APIClient {
    static let shared = APIClient()

    private let session: URLSession
    private let decoder: JSONDecoder

    private init() {
        let config = URLSessionConfiguration.default
        config.timeoutIntervalForRequest = 15
        config.timeoutIntervalForResource = 30
        self.session = URLSession(configuration: config)
        self.decoder = JSONDecoder()
    }

    func fetch<T: Decodable>(_ url: URL) async throws -> T {
        let (data, response) = try await session.data(from: url)

        guard let httpResponse = response as? HTTPURLResponse else {
            throw NetworkError.invalidResponse
        }

        guard (200...299).contains(httpResponse.statusCode) else {
            throw NetworkError.httpError(statusCode: httpResponse.statusCode)
        }

        do {
            return try decoder.decode(T.self, from: data)
        } catch {
            throw NetworkError.decodingError(underlying: error)
        }
    }

    func fetchRaw(_ url: URL) async throws -> Data {
        let (data, response) = try await session.data(from: url)

        guard let httpResponse = response as? HTTPURLResponse else {
            throw NetworkError.invalidResponse
        }

        guard (200...299).contains(httpResponse.statusCode) else {
            throw NetworkError.httpError(statusCode: httpResponse.statusCode)
        }

        return data
    }
}

// ABOUTME: Represents geographic coordinates for API queries
// ABOUTME: Used throughout the app for location-based risk lookups

import Foundation

struct Coordinate: Codable, Sendable, Equatable {
    let latitude: Double
    let longitude: Double

    var asArcGISPoint: String {
        // ArcGIS uses {x: longitude, y: latitude} format
        return "{\"x\":\(longitude),\"y\":\(latitude)}"
    }

    var asCommaSeparated: String {
        // Some APIs use "longitude,latitude" format
        return "\(longitude),\(latitude)"
    }
}

// ABOUTME: Standardized risk levels across all data sources
// ABOUTME: Maps to visual indicators (green/yellow/red) in the UI

import SwiftUI

enum RiskLevel: String, CaseIterable, Sendable {
    case low = "Low"
    case moderate = "Moderate"
    case high = "High"
    case unknown = "Unknown"

    var color: Color {
        switch self {
        case .low:
            return .green
        case .moderate:
            return .yellow
        case .high:
            return .red
        case .unknown:
            return .gray
        }
    }

    var systemImage: String {
        switch self {
        case .low:
            return "checkmark.circle.fill"
        case .moderate:
            return "exclamationmark.triangle.fill"
        case .high:
            return "xmark.octagon.fill"
        case .unknown:
            return "questionmark.circle.fill"
        }
    }
}

