// ABOUTME: Decodes WA DNR Wildland-Urban Interface query response
// ABOUTME: WUI_DESC_NM field contains classification text (Interface, Intermix, or null)

import Foundation

struct WUIQueryResponse: Codable {
    let features: [WUIFeature]
}

struct WUIFeature: Codable {
    let attributes: WUIAttributes
}

struct WUIAttributes: Codable {
    let OBJECTID: Int?
    let VALUE: Int?
    let WUI_DESC_NM: String?  // "Interface", "Intermix", or null
}

struct WildfireRiskResult: Sendable {
    let level: RiskLevel
    let wuiClassification: String?
    let summary: String
    let dataSource: String
}

// ABOUTME: Queries WA DNR WUI MapServer for wildfire interface classification
// ABOUTME: Uses ArcGIS REST query endpoint with point geometry

import Foundation

struct WildfireService {
    private let baseURL = "https://gis.dnr.wa.gov/site3/rest/services/Public_Wildfire/WADNR_PUBLIC_WD_WUI/MapServer/0/query"

    func checkWUI(at coordinate: Coordinate) async throws -> WildfireRiskResult {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        components.queryItems = [
            URLQueryItem(name: "geometry", value: coordinate.asArcGISPoint),
            URLQueryItem(name: "geometryType", value: "esriGeometryPoint"),
            URLQueryItem(name: "inSR", value: "4326"),
            URLQueryItem(name: "spatialRel", value: "esriSpatialRelIntersects"),
            URLQueryItem(name: "outFields", value: "WUI_DESC_NM,VALUE"),
            URLQueryItem(name: "returnGeometry", value: "false"),
            URLQueryItem(name: "f", value: "json")
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let response: WUIQueryResponse = try await APIClient.shared.fetch(url)

        return parseWUIResponse(response)
    }

    private func parseWUIResponse(_ response: WUIQueryResponse) -> WildfireRiskResult {
        guard let feature = response.features.first,
              let classification = feature.attributes.WUI_DESC_NM else {
            return WildfireRiskResult(
                level: .low,
                wuiClassification: nil,
                summary: "Not in Wildland-Urban Interface zone",
                dataSource: "WA DNR WUI 2019"
            )
        }

        let level: RiskLevel
        let summary: String

        switch classification.lowercased() {
        case "interface":
            level = .high
            summary = "WUI Interface - High wildfire risk area where homes meet wildland"
        case "intermix":
            level = .moderate
            summary = "WUI Intermix - Homes scattered among wildland vegetation"
        default:
            level = .low
            summary = "WUI Classification: \(classification)"
        }

        return WildfireRiskResult(
            level: level,
            wuiClassification: classification,
            summary: summary,
            dataSource: "WA DNR WUI 2019"
        )
    }
}

// ABOUTME: Decodes FEMA National Flood Hazard Layer query response
// ABOUTME: FLD_ZONE field contains flood zone designation (X, AE, VE, etc.)

import Foundation

struct NFHLQueryResponse: Codable {
    let features: [NFHLFeature]
}

struct NFHLFeature: Codable {
    let attributes: NFHLAttributes
}

struct NFHLAttributes: Codable {
    let FLD_ZONE: String?
    let ZONE_SUBTY: String?
    let SFHA_TF: String?  // Special Flood Hazard Area - "T" or "F"
}

struct FloodRiskResult: Sendable {
    let level: RiskLevel
    let floodZone: String?
    let isSpecialFloodHazardArea: Bool
    let summary: String
    let dataSource: String
}

// ABOUTME: Queries FEMA NFHL MapServer for flood zone classification
// ABOUTME: Layer 28 (S_Fld_Haz_Ar) contains regulatory flood zones

import Foundation

struct FloodService {
    private let baseURL = "https://hazards.fema.gov/gis/nfhl/rest/services/public/NFHL/MapServer/28/query"

    func checkFloodZone(at coordinate: Coordinate) async throws -> FloodRiskResult {
        guard var components = URLComponents(string: baseURL) else {
            throw NetworkError.invalidURL
        }

        components.queryItems = [
            URLQueryItem(name: "geometry", value: coordinate.asCommaSeparated),
            URLQueryItem(name: "geometryType", value: "esriGeometryPoint"),
            URLQueryItem(name: "inSR", value: "4326"),
            URLQueryItem(name: "spatialRel", value: "esriSpatialRelWithin"),
            URLQueryItem(name: "outFields", value: "FLD_ZONE,ZONE_SUBTY,SFHA_TF"),
            URLQueryItem(name: "returnGeometry", value: "false"),
            URLQueryItem(name: "f", value: "json")
        ]

        guard let url = components.url else {
            throw NetworkError.invalidURL
        }

        let response: NFHLQueryResponse = try await APIClient.shared.fetch(url)

        return parseFloodResponse(response)
    }

    private func parseFloodResponse(_ response: NFHLQueryResponse) -> FloodRiskResult {
        guard let feature = response.features.first,
              let zone = feature.attributes.FLD_ZONE else {
            return FloodRiskResult(
                level: .unknown,
                floodZone: nil,
                isSpecialFloodHazardArea: false,
                summary: "No flood zone data available for this location",
                dataSource: "FEMA NFHL"
            )
        }

        let isSFHA = feature.attributes.SFHA_TF == "T"
        let level: RiskLevel
        let summary: String

        switch zone.uppercased() {
        case "X", "AREA NOT INCLUDED":
            level = .low
            summary = "Zone X - Minimal flood hazard area"
        case "A", "AE", "AH", "AO", "AR":
            level = .high
            summary = "Zone \(zone) - Special Flood Hazard Area (1% annual chance flood)"
        case "V", "VE":
            level = .high
            summary = "Zone \(zone) - Coastal high velocity flood zone"
        case "D":
            level = .moderate
            summary = "Zone D - Undetermined flood hazard"
        default:
            level = .moderate
