            if !report.errors.isEmpty {
                VStack(alignment: .leading, spacing: 4) {
                    Label("Data Issues", systemImage: "exclamationmark.triangle")
                        .font(.caption)
                        .fontWeight(.semibold)
                    ForEach(report.errors, id: \.self) { error in
                        Text("- \(error)")
                            .font(.caption2)
                            .foregroundStyle(.red)
                    }
